import "./App.css";
import Barchart from "./components/Barchart";
import Piechart from "./components/Piechart";
import Metric from "./components/Metric";
import Wordcloud from "./components/Wordcloud";
import logo from "./assets/lta-logo.jpg";
import { Nav } from "react-bootstrap";

function App() {
  return (
    <div className="page">
      <Nav>
      <Nav.Brand>
      <strong className="title">
        <img src={logo}/>
        Dashboard for Chatbot Performance</strong>
      </Nav.Brand>
      </Nav>
      <div className="container">
        <div className="left">
          <Metric />
        </div>
        <div className="right">
          <Piechart />
        </div>
        <div className="left">
          <Barchart />
        </div>
        <div className="right">
          <Wordcloud />
        </div>
      </div>
    </div>
  );
}

export default App;
